  return (
    <div className="w-full pb-12">

      {/* Hero Container */}
      <Hero />

      {/* Tabs */}
      <Tabs />

      {/* Details */}
      <Details />

      {/* Carousels */}
      <Carousel />

      {/* Carousels */}
      <Carousel />

      {/* Footer */}
      <Footer />

    </div>
  );
};
export default DetailsScreen;
